import React from 'react';
import './DeadlockChart.css';

const DeadlockChart = () => {
  return (
    <div className="dashboard-panel chart-panel">
      <h2>Deadlock Resolution Logs</h2>
      <div className="chart-container">
        <div className="chart-placeholder">
          <div className="chart-line">
            <div className="chart-point" style={{left: '20%', bottom: '30%'}}>Deadlock</div>
            <div className="chart-point" style={{left: '40%', bottom: '50%'}}>Deadlock</div>
            <div className="chart-point" style={{left: '60%', bottom: '70%'}}>Resolved</div>
            <div className="chart-point" style={{left: '80%', bottom: '60%'}}>Resolved</div>
          </div>
        </div>
        <div className="chart-legend">
          <span className="legend-item legend-item--red">Resource Conflicts</span>
          <span className="legend-item legend-item--green">Successful Resolution</span>
          <span className="legend-item legend-item--orange">Partial Resolution Events</span>
        </div>
      </div>
    </div>
  );
};

export default DeadlockChart;
